const clickHandler = () => {
    setName('Al Issa')
}

    return (
        <View >

<Text>Log in</Text>
<View style = {styles.buttonContainer}>
<Button title = "login" onPress = {clickHandler}/>
     </View>
</View>
    )
}

const styles = StyleSheet.create({
containers: {
